.clearCatcher {
  fill-opacity: 0;
}
.bulletChart {
  overflow: auto;
}
.bulletChart .bullet {
  font-size: 12px;
  fill-opacity: 1;
}
.bulletChart .bullet .column {
  shape-rendering: crispEdges;
}
.bulletChart .bullet .subtitle,
.bulletChart .bullet .axis {
  font-size: 11px;
}
.bulletChart .bullet .marker {
  stroke-width: 2px;
  z-index: 999;
}
.bulletChart .title {
  font-weight: bold;
}
.bulletChart .axis path.bullet {
  stroke-width: 0px;
  fill: none;
}
.bulletChart .axis line {
  stroke-width: 0.5px;
}
.bulletChart .bulletContainer:focus {
  outline: none;
}
.bulletChart .bulletContainer:focus-visible {
  outline: -webkit-focus-ring-color auto 4px;
}
